import React from 'react';
import { Card, Collapse, Typography, Button, Tooltip } from 'antd'
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import { SaveOutlined } from '@ant-design/icons'

const { Title } = Typography
const { Panel } = Collapse

const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        flexGrow: 1
    },
    textField: {
        marginLeft: theme.spacing(1),
        marginRight: theme.spacing(1),
        width: '25ch',
    },
}));

function callback(key) {
    console.log(key);
}

const text = `
    A dog is a type of domesticated animal.
    Known for its loyalty and faithfulness,
    it can be found as a welcome guest in many households across the world.
`;

export default function DialogFlow() {
    const classes = useStyles();

    return (
        <Card>
            <Title style={{ fontSize: '2.5rem', textAlign: 'center', marginBottom: '2%' }}>Dialog Flow</Title>
            <form className={classes.root} noValidate autoComplete="off">
                <Grid item xs={11}>
                    <TextField id="intent" label="Intent" variant="outlined" required style={{ width: '100%', fontSize: '2rem' }} />
                </Grid>
                <Grid item xs={1}>
                    <Button type="primary" icon={<SaveOutlined style={{ fontSize: '1.75rem' }} />} style={{ marginLeft: '10px', height: '100%', width: '100%' }} />
                </Grid>
                <hr />
                <Grid item xs={12} style={{ marginTop: '5%' }}>
                    <Collapse defaultActiveKey={['1']} onChange={callback} ghost>
                        <Panel header="Training Phrases" key="1">
                            <p>{text}</p>
                        </Panel>
                        <Panel header="This is panel header 2" key="2">
                            <p>{text}</p>
                        </Panel>
                        <Panel header="This is panel header 3" key="3">
                            <p>{text}</p>
                        </Panel>
                    </Collapse>
                </Grid>
            </form>
        </Card>
    );
}
